import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import Dialogs_item from "./Components/Content/Dialogs/Dialogs_item/Dialogs_item";
import Message from "./Components/Content/Dialogs/Message/Message";

let dialogs_data = [
    {id: 1, name: "Yaroslav"},
    {id: 2, name: "Alex"},
    {id: 3, name: "Veronika"},
    {id: 4, name: "Naruto"},
    {id: 5, name: "Tanjiro"},
    {id: 6, name: "Kaneki"},
];
let messages_data = [
    {id: 1, message: "heyy"},
    {id: 2, message: "no"},
    {id: 3, message: "ok"},
    {id: 4, message: "the let's go"},
    {id: 5, message: "yeah that's great"},
    {id: 6, message: "welcome amazing"},
]
let dialogs_elements = dialogs_data.map
(dialog => <Dialogs_item id={dialog.id} name={dialog.name}/>);
let messages_elements = messages_data.map
(m => <Message message={m.message}/>);


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
